class Solution:
    def minStartValue(self, nums: List[int]) -> int:
        n = len(nums)
        dp = [0] * (n + 1)
        for i in range(1, n + 1):
            dp[i] = nums[i - 1] + dp[i - 1]

        for i in range(1, n + 1):
            if dp[i] <= 1:
                continue
            min_sum = dp[i]
            for j in range(i):
                if dp[j] > 1:
                    break
                min_sum += nums[j]
            if min_sum < 1:
                dp[i] = min_sum
        return dp[-1]

