def shortest(N, edgeList):
    import heapq
    dist = {}
    heap = [(0, 0)]
    for e in edgeList:
        dist[e[0]] = e[1]
        dist[e[1]] = e[0]
        heapq.heappush(heap, (dist[e[0]], e[0]))
        heapq.heappop(heap)
    m = N
    while heap:
        d, e = heapq.heappop(heap)
        if e not in dist:
            dist[e] = d
            m = min(m, e)
    return -1 if m == N else dist[m]

