import math
def is_prime(n):
    if n<=1: return False
    if n==2: return True
    if n%2==0 or n==1: return False
    for i in range(3,int(math.sqrt(n))+1,2):
        if n%i==0: return False
    return True

def step(g, m, n):
    primes = []
    for i in range(m,n+1):
        if is_prime(i):
            primes.append(i)
    if len(primes)==0: return None
    i = 0
    while True:
        if i==len(primes):
            break
        if primes[i]<=m:
            i+=1
        else:
            if step(g, primes[i], n):
                return [primes[i],primes[i+1]]
            elif step(g+1, primes[i], n):
                return [primes[i],primes[i+1]]

