from math import sqrt
class Vector:
    def __init__(self, *args):
        self.x, self.y, self.z = args[0], args[1], args[2]
        self.magnitude = sqrt(pow(self.x,2) + pow(self.y,2) + pow(self.z,2))
    def __add__(self, other):
        return Vector(self.x + other.x, self.y + other.y, self.z + other.z)
    def __sub__(self, other):
        return Vector(self.x - other.x, self.y - other.y, self.z - other.z)
    def cross(self, other):
        return Vector(self.x * other.y - self.y * other.x, self.y * other.z - self.z * other.y, self.z * other.x - self.x * other.z)
